import logo from '../../static/KPMG_logo_white.svg';
import PublishRoundedIcon from '@material-ui/icons/PublishRounded';

import React from 'react';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';

const useStyles = makeStyles((theme) => ({
    button: {
      margin: theme.spacing(1),
    },
    input: {
        display: 'none',
    },
  }));

export default function UploadBar() {
    const classes = useStyles();

    return(
        <div className='uploadbar_container'>
            <img src={logo} alt='kpmg_logo' style={{width:'80px', float:'left'}}/>
            <input accept="image/*" className={classes.input} type='file' multiple id='upload_btn'/>
            <Button color="default" className={classes.button} startIcon={<CloudUploadIcon />}>Upload</Button>
            <button id='upload_btn'><PublishRoundedIcon/></button>
        </div>
    );
};
